import Card from 'react-bootstrap/Card'
import {Col} from "react-bootstrap"


function SingleCard(props) {
    return(
        <Col className='FixedHeightContainer' md={12} lg={4}>
            <Card className='TotallyCenter CurvedContainer'  style={{backgroundColor:props.Color}}>
            <Card.Body className="OneCard">
                <div className='MidText UppercaseText NonCursiveFont SmMdFont GreenFontShade'>
                    {props.Title}
                </div>
                <div className='MidText NonCursiveFont VySmFont GreenFontShade'>
                    {props.Content}
                </div>
            </Card.Body>
            </Card>
        </Col>
    ); 
}

export default SingleCard;
